package xyz.Melody.Utils;

import java.io.File;
import java.io.FileInputStream;
import java.util.ArrayList;
import java.util.concurrent.ThreadLocalRandom;

import xyz.Melody.Main;

public class Icons {

	private static File iconDir;

	private static final String default_1 = "data:image/png;base64,",
			default_2 = "data:image/png;base64,",
			default_3 = "data:image/png;base64,",
			default_4 = "data:image/png;base64,";

	private static final ArrayList<String> favIcons = new ArrayList<String>();

	public static String getFavIcon() {
		int index = ThreadLocalRandom.current().nextInt(0, favIcons.size());
		return favIcons.get(index);
	}

	public static void readIcons() {

		iconDir = new File(Main.getMainDir(), "FavIcons");
		if (!iconDir.exists())
			iconDir.mkdir();

		File[] files = iconDir.listFiles();
		if (files == null || files.length == 0) {
			System.out.println("No favIcon file detected.");
			useDefault();
			return;
		}

		for (File file : files) {
			try (FileInputStream fis = new FileInputStream(file)) {
				byte[] fileBytes = fis.readAllBytes();
				if (!IconProcessor.checkPNGHeader(fileBytes)) {
					System.out.println(Colors.GRAY + "File: " + Colors.WHITE + file.getName() + Colors.GRAY
							+ " is not PNG format, skipping.");
					continue;
				}
				if (!IconProcessor.checkResolution(file)) {
					System.out.println(Colors.GRAY + "File: " + Colors.WHITE + file.getName() + Colors.GRAY
							+ " is not 64x64 resolution, skipping.");
					continue;
				}
				String icon = IconProcessor.base64lize(fileBytes);
				if (icon != null)
					favIcons.add(icon);
				else
					System.out.println("Can not convert " + Colors.WHITE + file.getName() + " to base64 format!");
			} catch (Exception e) {
				e.printStackTrace();
			}
		}
		if (favIcons.size() <= 0) {
			System.out.println("0 favIcon file detected.");
			useDefault();
			return;
		}
		System.out.println("Detected a total of " + favIcons.size() + " favIcon files.");
	}

	private static void useDefault() {
		favIcons.add(default_1);
		favIcons.add(default_2);
		favIcons.add(default_3);
		favIcons.add(default_4);
		System.out.println("Using default favIcons.");
	}
}
